import './nav.css';

const Nav = ()=>{
    return(
        <nav classNam="navbar navbar-expand-lg bg-light">
            <div classNam="container-fluid">
                <a classNam="navbar-brand" href="#">UrNOTES</a>
                <div classNam="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <div classNam="navbar-nav">
                        <a classNam="nav-link active" aria-current="page" href="#">Home</a>
                        <a classNam="nav-link" href="#">Create</a>
                        <a classNam="nav-link" href="#">Search</a>
                        <a classNam="nav-link" href="#">Login</a>
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
